    false,nt"url": null,nt"notes": "The HCL20032007 dataset contains High Crash
    Locations (HCLs) for intersections and sections for data years 2003-2007. The HCLs
    in this dataset are based on the number of crashes and not the severity of the crashes.
    The intersections and sections analyzed in this dataset are limited to those highways
    that fall under the Federal Aid Highway system. A good overview of of the 2003-2007
    HCL data is available in this PDF http://www.aot.state.vt.us/Planning/Documents/HighResearch/Publications/Narrative2003to2007HCL-IntersandSects.pdf",nt"license_title":
